import React, { useRef, useState } from "react";
import { Form, Row, Col, Container, Button, ListGroup } from 'react-bootstrap';
import { tempAddCity } from '../APIs/LoginAPIs';

export default function TestComponent() {

    const textRef = useRef();
    const mainTableRef = useRef();
    const langTableRef = useRef();
    const langIdRef = useRef();
    const masterTableIdNameRef = useRef();
    const masterTableIdRef = useRef();

    const [listAreas, setListAreas] = useState([]);

    const cleanHandler = () => {
        let tempStr = textRef.current.value;
    
        let tempArr = tempStr.split("<option value=\"\">")[1].split("</option>");    
        
        let resArr = [];

        for (let i = 1; i < tempArr.length - 1; i++) {
            let tempNumber = tempArr[i].split("\">")[0].split("\"")[1];
            let tempName = tempArr[i].split("\">")[1];
            resArr.push({number: tempNumber, name: tempName});

            tempAddCity(tempNumber, tempName, tableName, tableLangName, langId, masterTableIdName, masterTableId).then((res) => {
                console.log(res.data);
            })
        }

        setListAreas(resArr);
    }

    return (
        <Container fluid>
            <Row>
                <Col className="d-flex justify-content-center"><span className="h1">This is a test component!</span></Col>
            </Row>

            <Row>
                <Col lg={6}>
                    <Form.Group controlId="exampleForm.ControlTextarea1">
                        <Form.Label>Enter options to clear:</Form.Label>
                        <Form.Control style={{ height: "300px", overflowY: "scroll" }} as="textarea" rows={100} ref={textRef} />
                    </Form.Group>

                    <Form.Group className="mt-2" controlId="exampleForm.ControlTextarea1">
                        <Form.Label>Main Table:</Form.Label>
                        <Form.Control type="text" placeholder="tb..." ref={mainTableRef} />
                    </Form.Group>

                    <Form.Group className="mt-2" controlId="exampleForm.ControlTextarea1">
                        <Form.Label>Lang Table:</Form.Label>
                        <Form.Control type="text" placeholder="langtb..." ref={langTableRef} />
                    </Form.Group>

                    <Form.Group className="mt-2 mb-5" controlId="exampleForm.ControlTextarea1">
                        <Form.Label>Language ID:</Form.Label>
                        <Form.Control type="text" placeholder="1 -> EN / 2 -> AR" ref={langIdRef} />
                    </Form.Group>

                    <Form.Group className="mt-2 mb-5" controlId="exampleForm.ControlTextarea1">
                        <Form.Label>Master Table ID Name:</Form.Label>
                        <Form.Control type="text" placeholder="masterIdName" ref={masterTableIdNameRef} />
                    </Form.Group>

                    <Form.Group className="mt-2 mb-5" controlId="exampleForm.ControlTextarea1">
                        <Form.Label>Master Table ID:</Form.Label>
                        <Form.Control type="text" placeholder="masterId" ref={masterTableIdRef} />
                    </Form.Group>
                </Col>

                <Col lg={1}>
                    <Button className="mt-5" onClick={cleanHandler}>
                        clean
                    </Button>
                </Col>

                <Col lg={5}>
                    <ListGroup className="mt-4">
                        {
                            listAreas.map((item, index) => {
                                return <ListGroup.Item key={index}>{item.number + " - " + item.name}</ListGroup.Item>
                            })
                        }
                    </ListGroup>
                </Col>
            </Row>
        </Container>
    )
}
